import React, { useState, useMemo } from "react";
import DataTable from "react-data-table-component";
import toast from "react-hot-toast";
import {
  useGetModelsAdminQuery,
  useUpdateModelStatusMutation,
} from "../../../redux/api/adminModelApi";
import ModelForm from "./ModelForm";

const ModelList = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [statusFilter, setStatusFilter] = useState("all");

  const [showForm, setShowForm] = useState(false);
  const [editModel, setEditModel] = useState(null);

  const { data, isLoading, refetch } = useGetModelsAdminQuery();
  const [updateStatus] = useUpdateModelStatusMutation();

  const models = data?.models || [];

  const filteredModels = useMemo(() => {
    return models.filter((m) => {
      if (statusFilter !== "all" && m.status !== statusFilter) return false;

      if (!searchTerm.trim()) return true;

      const target =
        `${m.firstName} ${m.stageName} ${m.email} ${m.city}`.toLowerCase();

      return target.includes(searchTerm.toLowerCase());
    });
  }, [models, searchTerm, statusFilter]);

  const changeStatus = async (id, status) => {
    await updateStatus({ id, status }).unwrap();
    toast.success("Status updated");
    refetch();
  };

  const columns = [
    { name: "Name", selector: (r) => r.stageName || r.firstName },
    { name: "Email", selector: (r) => r.email || "-" },
    { name: "City", selector: (r) => r.city || "-" },
    {
      name: "Status",
      selector: (r) => r.status,
      cell: (r) => (
        <span
          className={`badge bg-${
            r.status === "approved" ? "success" : "warning"
          }`}
        >
          {r.status}
        </span>
      ),
    },
    {
      name: "Actions",
      cell: (row) => (
        <div className="dropdown">
          <button
            className="btn btn-sm btn-secondary dropdown-toggle"
            data-bs-toggle="dropdown"
          >
            Actions
          </button>
          <ul className="dropdown-menu">
            <li>
              <button
                className="dropdown-item"
                onClick={() => {
                  setEditModel(row);
                  setShowForm(true);
                }}
              >
                Edit
              </button>
            </li>
            <li>
              <button
                className="dropdown-item"
                onClick={() => changeStatus(row._id, "approved")}
              >
                Approve
              </button>
            </li>
            <li>
              <button
                className="dropdown-item"
                onClick={() => changeStatus(row._id, "rejected")}
              >
                Reject
              </button>
            </li>
          </ul>
        </div>
      ),
      ignoreRowClick: true,
    },
  ];

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between mb-3">
        <h2>Models</h2>
        <button
          className="btn btn-primary"
          onClick={() => setShowForm(!showForm)}
        >
          {showForm ? "Close Form" : "Add Model"}
        </button>
      </div>

      {showForm && (
        <ModelForm
          model={editModel}
          onClose={() => {
            setShowForm(false);
            setEditModel(null);
          }}
          refetch={refetch}
        />
      )}

      {/* STATUS FILTER */}
      <div className="mb-3 d-flex gap-2">
        {["all", "pending", "approved", "rejected"].map((s) => (
          <button
            key={s}
            className={`btn btn-sm ${
              statusFilter === s ? "btn-dark" : "btn-outline-dark"
            }`}
            onClick={() => setStatusFilter(s)}
          >
            {s}
          </button>
        ))}
      </div>

      <input
        className="form-control mb-3"
        placeholder="Search models..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />

      <DataTable
        columns={columns}
        data={filteredModels}
        pagination
        progressPending={isLoading}
        highlightOnHover
        responsive
      />
    </div>
  );
};

export default ModelList;
